msg.payload.renewables = 0;
msg.payload.carbonfree = 0;
msg.payload.data.generationmix.forEach(function(element) {
    if (element.fuel == "hydro" || element.fuel == "solar" || element.fuel == "wind") {
        msg.payload.renewables = msg.payload.renewables + element.perc;
        msg.payload.carbonfree = msg.payload.carbonfree + element.perc;
    };
    if (element.fuel == "nuclear") {
        msg.payload.carbonfree = msg.payload.carbonfree + element.perc;
    }
});
msg.payload.renewables = parseFloat(msg.payload.renewables).toFixed(1);
msg.payload.carbonfree = parseFloat(msg.payload.carbonfree).toFixed(1);
return msg;

